import React from 'react';
import {Route, Switch} from 'react-router-dom';
import Home from '../Component/Home';


const Routes = (props) => {
    <React.Fragment>
        <Route path="/" >
            <Home></Home>
        </Route>
    </React.Fragment>
}

export default Routes;
